@testset "6.6.2 (e x)^m (a+b csch(c+d x^n))^p" begin
    @variables a, b, c, d, e, m, n, p, x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(e*x)^m*(a+b*csch(c+d*x^n))^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(e*x)^m*(a+b*csch(c+d*x^2))^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(a+b*csch(c+d*x^2))^p=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [x^5*(a + b*csch(c + d*x^2)), x, 10, (a*x^6)/6 - (b*x^4*atanh(ℯ^(c + d*x^2)))/d - (b*x^2*PolyLog(2, -ℯ^(c + d*x^2)))/d^2 + (b*x^2*PolyLog(2, ℯ^(c + d*x^2)))/d^2 + (b*PolyLog(3, -ℯ^(c + d*x^2)))/d^3 - (b*PolyLog(3, ℯ^(c + d*x^2)))/d^3]
    @test_int [x^4*(a + b*csch(c + d*x^2)), x, 2, (a*x^5)/5 + b*Unintegrable(x^4*csch(c + d*x^2), x)]
    @test_int [x^3*(a + b*csch(c + d*x^2)), x, 8, (a*x^4)/4 - (b*x^2*atanh(ℯ^(c + d*x^2)))/d - (b*PolyLog(2, -ℯ^(c + d*x^2)))/(2*d^2) + (b*PolyLog(2, ℯ^(c + d*x^2)))/(2*d^2)]
    @test_int [x^2*(a + b*csch(c + d*x^2)), x, 2, (a*x^3)/3 + b*Unintegrable(x^2*csch(c + d*x^2), x)]
    @test_int [x*(a + b*csch(c + d*x^2)), x, 4, (a*x^2)/2 - (b*atanh(cosh(c + d*x^2)))/(2*d)]
    @test_int [(a + b*csch(c + d*x^2))/x, x, 2, a*log(x) + b*Unintegrable(csch(c + d*x^2)/x, x)]
    @test_int [(a + b*csch(c + d*x^2))/x^2, x, 2, -(a/x) + b*Unintegrable(csch(c + d*x^2)/x^2, x)]


    @test_int [x^5*(a + b*csch(c + d*x^2))^2, x, 15, -((b^2*x^4)/(2*d)) + (a^2*x^6)/6 - (2*a*b*x^4*atanh(ℯ^(c + d*x^2)))/d - (b^2*x^4*coth(c + d*x^2))/(2*d) + (b^2*x^2*log(1 - ℯ^(2*(c + d*x^2))))/d^2 - (2*a*b*x^2*PolyLog(2, -ℯ^(c + d*x^2)))/d^2 + (2*a*b*x^2*PolyLog(2, ℯ^(c + d*x^2)))/d^2 + (b^2*PolyLog(2, ℯ^(2*(c + d*x^2))))/(2*d^3) + (2*a*b*PolyLog(3, -ℯ^(c + d*x^2)))/d^3 - (2*a*b*PolyLog(3, ℯ^(c + d*x^2)))/d^3]
    @test_int [x^4*(a + b*csch(c + d*x^2))^2, x, 0, Unintegrable(x^4*(a + b*csch(c + d*x^2))^2, x)]
    @test_int [x^3*(a + b*csch(c + d*x^2))^2, x, 10, (a^2*x^4)/4 - (2*a*b*x^2*atanh(ℯ^(c + d*x^2)))/d - (b^2*x^2*coth(c + d*x^2))/(2*d) + (b^2*log(sinh(c + d*x^2)))/(2*d^2) - (a*b*PolyLog(2, -ℯ^(c + d*x^2)))/d^2 + (a*b*PolyLog(2, ℯ^(c + d*x^2)))/d^2]
    @test_int [x^2*(a + b*csch(c + d*x^2))^2, x, 0, Unintegrable(x^2*(a + b*csch(c + d*x^2))^2, x)]
    @test_int [x*(a + b*csch(c + d*x^2))^2, x, 5, (a^2*x^2)/2 - (a*b*atanh(cosh(c + d*x^2)))/d - (b^2*coth(c + d*x^2))/(2*d)]
    @test_int [(a + b*csch(c + d*x^2))^2/x, x, 0, Unintegrable((a + b*csch(c + d*x^2))^2/x, x)]
    @test_int [(a + b*csch(c + d*x^2))^2/x^2, x, 0, Unintegrable((a + b*csch(c + d*x^2))^2/x^2, x)]


    @test_int [x*csch(a + b*x^2)^7, x, 5, (5*atanh(cosh(a + b*x^2)))/(32*b) - (5*coth(a + b*x^2)*csch(a + b*x^2))/(32*b) + (5*coth(a + b*x^2)*csch(a + b*x^2)^3)/(48*b) - (coth(a + b*x^2)*csch(a + b*x^2)^5)/(12*b)]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [x^5/(a + b*csch(c + d*x^2)), x, 13, x^6/(6*a) - (b*x^4*log(1 + (a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2))))/(2*a*sqrt(a^2 + b^2)*d) + (b*x^4*log(1 + (a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2))))/(2*a*sqrt(a^2 + b^2)*d) - (b*x^2*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2)))))/(a*sqrt(a^2 + b^2)*d^2) + (b*x^2*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2)))))/(a*sqrt(a^2 + b^2)*d^2) + (b*PolyLog(3, -((a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2)))))/(a*sqrt(a^2 + b^2)*d^3) - (b*PolyLog(3, -((a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2)))))/(a*sqrt(a^2 + b^2)*d^3)]
    @test_int [x^4/(a + b*csch(c + d*x^2)), x, 0, Unintegrable(x^4/(a + b*csch(c + d*x^2)), x)]
    @test_int [x^3/(a + b*csch(c + d*x^2)), x, 11, x^4/(4*a) - (b*x^2*log(1 + (a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2))))/(2*a*sqrt(a^2 + b^2)*d) + (b*x^2*log(1 + (a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2))))/(2*a*sqrt(a^2 + b^2)*d) - (b*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2)))))/(2*a*sqrt(a^2 + b^2)*d^2) + (b*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2)))))/(2*a*sqrt(a^2 + b^2)*d^2)]
    @test_int [x^2/(a + b*csch(c + d*x^2)), x, 0, Unintegrable(x^2/(a + b*csch(c + d*x^2)), x)]
    @test_int [x/(a + b*csch(c + d*x^2)), x, 5, x^2/(2*a) + (b*atanh((a - b*tanh((c + d*x^2)/2))/sqrt(a^2 + b^2)))/(a*sqrt(a^2 + b^2)*d)]
    @test_int [1/(x*(a + b*csch(c + d*x^2))), x, 0, Unintegrable(1/(x*(a + b*csch(c + d*x^2))), x)]
    @test_int [(a + b*csch(c + d*x^2))/x^2, x, 2, -(a/x) + b*Unintegrable(csch(c + d*x^2)/x^2, x)]


    @test_int [x^5/(a + b*csch(c + d*x^2))^2, x, 31, -(b^2*x^4)/(2*a^2*(a^2 + b^2)*d) + x^6/(6*a^2) + (b^2*x^2*log(1 + (a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2))))/(a^2*(a^2 + b^2)*d^2) + (b^3*x^4*log(1 + (a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2))))/(2*a^2*(a^2 + b^2)^(3/2)*d) - (b*x^4*log(1 + (a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2))))/(a^2*sqrt(a^2 + b^2)*d) + (b^2*x^2*log(1 + (a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2))))/(a^2*(a^2 + b^2)*d^2) - (b^3*x^4*log(1 + (a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2))))/(2*a^2*(a^2 + b^2)^(3/2)*d) + (b*x^4*log(1 + (a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2))))/(a^2*sqrt(a^2 + b^2)*d) + (b^2*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2)))))/(a^2*(a^2 + b^2)*d^3) + (b^3*x^2*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2)))))/(a^2*(a^2 + b^2)^(3/2)*d^2) - (2*b*x^2*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2)))))/(a^2*sqrt(a^2 + b^2)*d^2) + (b^2*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2)))))/(a^2*(a^2 + b^2)*d^3) - (b^3*x^2*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2)))))/(a^2*(a^2 + b^2)^(3/2)*d^2) + (2*b*x^2*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2)))))/(a^2*sqrt(a^2 + b^2)*d^2) - (b^3*PolyLog(3, -((a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2)))))/(a^2*(a^2 + b^2)^(3/2)*d^3) + (2*b*PolyLog(3, -((a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2)))))/(a^2*sqrt(a^2 + b^2)*d^3) + (b^3*PolyLog(3, -((a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2)))))/(a^2*(a^2 + b^2)^(3/2)*d^3) - (2*b*PolyLog(3, -((a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2)))))/(a^2*sqrt(a^2 + b^2)*d^3) - (b^2*x^4*cosh(c + d*x^2))/(2*a*(a^2 + b^2)*d*(b + a*sinh(c + d*x^2)))]
    @test_int [x^4/(a + b*csch(c + d*x^2))^2, x, 0, Unintegrable(x^4/(a + b*csch(c + d*x^2))^2, x)]
    @test_int [x^3/(a + b*csch(c + d*x^2))^2, x, 22, x^4/(4*a^2) + (b^3*x^2*log(1 + (a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2))))/(2*a^2*(a^2 + b^2)^(3/2)*d) - (b*x^2*log(1 + (a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2))))/(a^2*sqrt(a^2 + b^2)*d) - (b^3*x^2*log(1 + (a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2))))/(2*a^2*(a^2 + b^2)^(3/2)*d) + (b*x^2*log(1 + (a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2))))/(a^2*sqrt(a^2 + b^2)*d) + (b^2*log(b + a*sinh(c + d*x^2)))/(2*a^2*(a^2 + b^2)*d^2) + (b^3*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2)))))/(2*a^2*(a^2 + b^2)^(3/2)*d^2) - (b*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b - sqrt(a^2 + b^2)))))/(a^2*sqrt(a^2 + b^2)*d^2) - (b^3*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2)))))/(2*a^2*(a^2 + b^2)^(3/2)*d^2) + (b*PolyLog(2, -((a*ℯ^(c + d*x^2))/(b + sqrt(a^2 + b^2)))))/(a^2*sqrt(a^2 + b^2)*d^2) - (b^2*x^2*cosh(c + d*x^2))/(2*a*(a^2 + b^2)*d*(b + a*sinh(c + d*x^2)))]
    @test_int [x^2/(a + b*csch(c + d*x^2))^2, x, 0, Unintegrable(x^2/(a + b*csch(c + d*x^2))^2, x)]
    @test_int [x/(a + b*csch(c + d*x^2))^2, x, 7, x^2/(2*a^2) + (b*(2*a^2 + b^2)*atanh((a - b*tanh((c + d*x^2)/2))/sqrt(a^2 + b^2)))/(a^2*(a^2 + b^2)^(3/2)*d) - (b^2*coth(c + d*x^2))/(2*a*(a^2 + b^2)*d*(a + b*csch(c + d*x^2)))]
    @test_int [1/(x*(a + b*csch(c + d*x^2))^2), x, 0, Unintegrable(1/(x*(a + b*csch(c + d*x^2))^2), x)]
    @test_int [1/(x^2*(a + b*csch(c + d*x^2))^2), x, 0, Unintegrable(1/(x^2*(a + b*csch(c + d*x^2))^2), x)]
    @test_int [1/(x^3*(a + b*csch(c + d*x^2))^2), x, 0, Unintegrable(1/(x^3*(a + b*csch(c + d*x^2))^2), x)]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(e*x)^m*(a+b*csch(c+d*x^(1/2)))^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(a+b*csch(c+d*x^(1/2)))^p=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [x^3*(a + b*csch(c + d*sqrt(x))), x, 20, (a*x^4)/4 - (4*b*x^(7/2)*atanh(ℯ^(c + d*sqrt(x))))/d - (14*b*x^3*PolyLog(2, -ℯ^(c + d*sqrt(x))))/d^2 + (14*b*x^3*PolyLog(2, ℯ^(c + d*sqrt(x))))/d^2 + (84*b*x^(5/2)*PolyLog(3, -ℯ^(c + d*sqrt(x))))/d^3 - (84*b*x^(5/2)*PolyLog(3, ℯ^(c + d*sqrt(x))))/d^3 - (420*b*x^2*PolyLog(4, -ℯ^(c + d*sqrt(x))))/d^4 + (420*b*x^2*PolyLog(4, ℯ^(c + d*sqrt(x))))/d^4 + (1680*b*x^(3/2)*PolyLog(5, -ℯ^(c + d*sqrt(x))))/d^5 - (1680*b*x^(3/2)*PolyLog(5, ℯ^(c + d*sqrt(x))))/d^5 - (5040*b*x*PolyLog(6, -ℯ^(c + d*sqrt(x))))/d^6 + (5040*b*x*PolyLog(6, ℯ^(c + d*sqrt(x))))/d^6 + (10080*b*sqrt(x)*PolyLog(7, -ℯ^(c + d*sqrt(x))))/d^7 - (10080*b*sqrt(x)*PolyLog(7, ℯ^(c + d*sqrt(x))))/d^7 - (10080*b*PolyLog(8, -ℯ^(c + d*sqrt(x))))/d^8 + (10080*b*PolyLog(8, ℯ^(c + d*sqrt(x))))/d^8]
    @test_int [x^2*(a + b*csch(c + d*sqrt(x))), x, 16, (a*x^3)/3 - (4*b*x^(5/2)*atanh(ℯ^(c + d*sqrt(x))))/d - (10*b*x^2*PolyLog(2, -ℯ^(c + d*sqrt(x))))/d^2 + (10*b*x^2*PolyLog(2, ℯ^(c + d*sqrt(x))))/d^2 + (40*b*x^(3/2)*PolyLog(3, -ℯ^(c + d*sqrt(x))))/d^3 - (40*b*x^(3/2)*PolyLog(3, ℯ^(c + d*sqrt(x))))/d^3 - (120*b*x*PolyLog(4, -ℯ^(c + d*sqrt(x))))/d^4 + (120*b*x*PolyLog(4, ℯ^(c + d*sqrt(x))))/d^4 + (240*b*sqrt(x)*PolyLog(5, -ℯ^(c + d*sqrt(x))))/d^5 - (240*b*sqrt(x)*PolyLog(5, ℯ^(c + d*sqrt(x))))/d^5 - (240*b*PolyLog(6, -ℯ^(c + d*sqrt(x))))/d^6 + (240*b*PolyLog(6, ℯ^(c + d*sqrt(x))))/d^6]
    @test_int [x*(a + b*csch(c + d*sqrt(x))), x, 12, (a*x^2)/2 - (4*b*x^(3/2)*atanh(ℯ^(c + d*sqrt(x))))/d - (6*b*x*PolyLog(2, -ℯ^(c + d*sqrt(x))))/d^2 + (6*b*x*PolyLog(2, ℯ^(c + d*sqrt(x))))/d^2 + (12*b*sqrt(x)*PolyLog(3, -ℯ^(c + d*sqrt(x))))/d^3 - (12*b*sqrt(x)*PolyLog(3, ℯ^(c + d*sqrt(x))))/d^3 - (12*b*PolyLog(4, -ℯ^(c + d*sqrt(x))))/d^4 + (12*b*PolyLog(4, ℯ^(c + d*sqrt(x))))/d^4]
    @test_int [(a + b*csch(c + d*sqrt(x)))/x, x, 2, a*log(x) + b*Unintegrable(csch(c + d*sqrt(x))/x, x)]
    @test_int [(a + b*csch(c + d*sqrt(x)))/x^2, x, 2, -(a/x) + b*Unintegrable(csch(c + d*sqrt(x))/x^2, x)]


    @test_int [x^3*(a + b*csch(c + d*sqrt(x)))^2, x, 30, -((2*b^2*x^(7/2))/d) + (a^2*x^4)/4 - (8*a*b*x^(7/2)*atanh(ℯ^(c + d*sqrt(x))))/d - (2*b^2*x^(7/2)*coth(c + d*sqrt(x)))/d + (14*b^2*x^3*log(1 - ℯ^(2*(c + d*sqrt(x)))))/d^2 - (28*a*b*x^3*PolyLog(2, -ℯ^(c + d*sqrt(x))))/d^2 + (28*a*b*x^3*PolyLog(2, ℯ^(c + d*sqrt(x))))/d^2 + (42*b^2*x^(5/2)*PolyLog(2, ℯ^(2*(c + d*sqrt(x)))))/d^3 + (168*a*b*x^(5/2)*PolyLog(3, -ℯ^(c + d*sqrt(x))))/d^3 - (168*a*b*x^(5/2)*PolyLog(3, ℯ^(c + d*sqrt(x))))/d^3 - (105*b^2*x^2*PolyLog(3, ℯ^(2*(c + d*sqrt(x)))))/d^4 - (840*a*b*x^2*PolyLog(4, -ℯ^(c + d*sqrt(x))))/d^4 + (840*a*b*x^2*PolyLog(4, ℯ^(c + d*sqrt(x))))/d^4 + (210*b^2*x^(3/2)*PolyLog(4, ℯ^(2*(c + d*sqrt(x)))))/d^5 + (3360*a*b*x^(3/2)*PolyLog(5, -ℯ^(c + d*sqrt(x))))/d^5 - (3360*a*b*x^(3/2)*PolyLog(5, ℯ^(c + d*sqrt(x))))/d^5 - (315*b^2*x*PolyLog(5, ℯ^(2*(c + d*sqrt(x)))))/d^6 - (10080*a*b*x*PolyLog(6, -ℯ^(c + d*sqrt(x))))/d^6 + (10080*a*b*x*PolyLog(6, ℯ^(c + d*sqrt(x))))/d^6 + (315*b^2*sqrt(x)*PolyLog(6, ℯ^(2*(c + d*sqrt(x)))))/d^7 + (20160*a*b*sqrt(x)*PolyLog(7, -ℯ^(c + d*sqrt(x))))/d^7 - (20160*a*b*sqrt(x)*PolyLog(7, ℯ^(c + d*sqrt(x))))/d^7 - (315*b^2*PolyLog(7, ℯ^(2*(c + d*sqrt(x)))))/(2*d^8) - (20160*a*b*PolyLog(8, -ℯ^(c + d*sqrt(x))))/d^8 + (20160*a*b*PolyLog(8, ℯ^(c + d*sqrt(x))))/d^8]
    @test_int [x^2*(a + b*csch(c + d*sqrt(x)))^2, x, 24, -((2*b^2*x^(5/2))/d) + (a^2*x^3)/3 - (8*a*b*x^(5/2)*atanh(ℯ^(c + d*sqrt(x))))/d - (2*b^2*x^(5/2)*coth(c + d*sqrt(x)))/d + (10*b^2*x^2*log(1 - ℯ^(2*(c + d*sqrt(x)))))/d^2 - (20*a*b*x^2*PolyLog(2, -ℯ^(c + d*sqrt(x))))/d^2 + (20*a*b*x^2*PolyLog(2, ℯ^(c + d*sqrt(x))))/d^2 + (20*b^2*x^(3/2)*PolyLog(2, ℯ^(2*(c + d*sqrt(x)))))/d^3 + (80*a*b*x^(3/2)*PolyLog(3, -ℯ^(c + d*sqrt(x))))/d^3 - (80*a*b*x^(3/2)*PolyLog(3, ℯ^(c + d*sqrt(x))))/d^3 - (30*b^2*x*PolyLog(3, ℯ^(2*(c + d*sqrt(x)))))/d^4 - (240*a*b*x*PolyLog(4, -ℯ^(c + d*sqrt(x))))/d^4 + (240*a*b*x*PolyLog(4, ℯ^(c + d*sqrt(x))))/d^4 + (30*b^2*sqrt(x)*PolyLog(4, ℯ^(2*(c + d*sqrt(x)))))/d^5 + (480*a*b*sqrt(x)*PolyLog(5, -ℯ^(c + d*sqrt(x))))/d^5 - (480*a*b*sqrt(x)*PolyLog(5, ℯ^(c + d*sqrt(x))))/d^5 - (15*b^2*PolyLog(5, ℯ^(2*(c + d*sqrt(x)))))/d^6 - (480*a*b*PolyLog(6, -ℯ^(c + d*sqrt(x))))/d^6 + (480*a*b*PolyLog(6, ℯ^(c + d*sqrt(x))))/d^6]
    @test_int [x*(a + b*csch(c + d*sqrt(x)))^2, x, 18, -((2*b^2*x^(3/2))/d) + (a^2*x^2)/2 - (8*a*b*x^(3/2)*atanh(ℯ^(c + d*sqrt(x))))/d - (2*b^2*x^(3/2)*coth(c + d*sqrt(x)))/d + (6*b^2*x*log(1 - ℯ^(2*(c + d*sqrt(x)))))/d^2 - (12*a*b*x*PolyLog(2, -ℯ^(c + d*sqrt(x))))/d^2 + (12*a*b*x*PolyLog(2, ℯ^(c + d*sqrt(x))))/d^2 + (6*b^2*sqrt(x)*PolyLog(2, ℯ^(2*(c + d*sqrt(x)))))/d^3 + (24*a*b*sqrt(x)*PolyLog(3, -ℯ^(c + d*sqrt(x))))/d^3 - (24*a*b*sqrt(x)*PolyLog(3, ℯ^(c + d*sqrt(x))))/d^3 - (3*b^2*PolyLog(3, ℯ^(2*(c + d*sqrt(x)))))/d^4 - (24*a*b*PolyLog(4, -ℯ^(c + d*sqrt(x))))/d^4 + (24*a*b*PolyLog(4, ℯ^(c + d*sqrt(x))))/d^4]
